import React from 'react';

const SuperHeader = React.memo(function(props){

    return <thead> {/*div header*/}
        <tr> {/*real header*/}
            <th key={0}>hui</th> {/*каждая колонка*/}
            <th key={1}>hui</th>
            <th key={2}>hui</th>
        </tr>
    </thead>
});

export default SuperHeader;
